                <div className="login-status__header">
                    <p>ユーザーとログイン状況</p>
                </div>
                <ul className="login-status__body">
                    <li className="login-status__body__item">
                        <img src='/images/star.jpeg' />
                        <span>名前</span>
                        <div>
                            <span></span>
                        </div>
                    </li>
                </ul>
                <style jsx>{`
                .login-status {
                    width: 280px;
                }
                .login-status__header {
                    padding: 10px;
                    text-align: center;
                }
                .login-status__body {
                    padding: 10px;
                }
                .login-status__body__item {
                    display: flex;
                }
                .login-status__body__item img {
                    width: 20%;
                }
                .login-staus__body__item span {
                    width: 70%;
                }
                .login-status__body__item div {
                    width: 10%;
                }
                .login-status__body__item div span {

                }
                `}</style>
            </div>
        )
    }
}
